CREATE SEQUENCE "CricketSelection"."Players_playerId_seq"
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 2147483647
    CACHE 1;

ALTER SEQUENCE "CricketSelection"."Players_playerId_seq"
    OWNER TO postgres;
	
-- Table: CricketSelection.Players

-- DROP TABLE "CricketSelection"."Players";

CREATE TABLE IF NOT EXISTS "CricketSelection"."Players"
(
    "playerId" integer NOT NULL DEFAULT nextval('"CricketSelection"."Players_playerId_seq"'::regclass),
    "playerName" character varying COLLATE pg_catalog."default",
    "playerCountry" character varying COLLATE pg_catalog."default",
    "playerType" character varying COLLATE pg_catalog."default",
    "playerHeight" real,
    "playerBmi" real,
    "playerRuns" integer,
    "playerWickets" integer,
    "playerStumpings" integer,
    CONSTRAINT pk_player_id PRIMARY KEY ("playerId")
)

TABLESPACE pg_default;

ALTER TABLE "CricketSelection"."Players"
    OWNER to postgres;
-- Index: idx_player_bmi

-- DROP INDEX "CricketSelection".idx_player_bmi;

CREATE INDEX idx_player_bmi
    ON "CricketSelection"."Players" USING btree
    ("playerBmi" ASC NULLS LAST)
    TABLESPACE pg_default;
-- Index: idx_player_height

-- DROP INDEX "CricketSelection".idx_player_height;

CREATE INDEX idx_player_height
    ON "CricketSelection"."Players" USING btree
    ("playerHeight" ASC NULLS LAST)
    TABLESPACE pg_default;
-- Index: idx_player_type

-- DROP INDEX "CricketSelection".idx_player_type;

CREATE INDEX idx_player_type
    ON "CricketSelection"."Players" USING btree
    ("playerType" COLLATE pg_catalog."default" ASC NULLS LAST)
    TABLESPACE pg_default;

